import React  from 'react';
import { ListGroup, ListGroupItem,  Container, Row, Col } from 'reactstrap';



  function RenderModulesItem({data}){
    return(

      <div className="container">
        <ListGroup>

          <ListGroupItem>
             <h3>{data.name}</h3>
            <Row>
              <Col>
              <p>{data.category}</p>
              <p>{data.label}</p>
              </Col>
              <Col>
              <p>{data.price}</p>
              <p>{data.description}</p>
             </Col>
            </Row>


          </ListGroupItem>
        </ListGroup>
       <br />

      </div>    



    );
  }
  function CourseModulesItem({syllabus}){
   return(
     <div class="container">
     <h3>{syllabus.name}</h3>
     </div>

   );
  }

   const Modules = (props) => {
    const modules = props.datas.map((data) => {
      return (
        <div key={data.id} className="col-12 col-md-10">
        <RenderModulesItem data={data} />
        <CourseModulesItem data={syllabus} />
        </div>


      );
    });

	  return(
      <div className="container">
        <div className="row">
        <div className="col-12">

          {modules}
          </div>
        </div>
      </div>
    );
  }



export default Modules;
